// import logo from './logo.svg';
import './App.css';
import { Card, /*Image*/ Icon } from 'semantic-ui-react'
import { FiInstagram } from "react-icons/fi";
import { FiLinkedin } from "react-icons/fi";
import { FiGithub } from "react-icons/fi";

import {center} from "./assets/center.png";
import {yellowcircle} from "./assets/Ellipse1.png";
import {Ellipse2} from "./assets/Ellipse2.png";
// import {} from "src/assets";
// import {} from "src/assets";
// import {} from "src/assets";
// import {} from "src/assets";
// import {} from "src/assets";
// import {} from "src/assets";

const styleLink = document.createElement("link");
styleLink.rel = "stylesheet";
styleLink.href = 
"https://cdn.jsdelivr.net/npm/semantic-ui/dist/semantic.min.css";
document.head.appendChild(styleLink);

function App() {
  return (
    <div className="App">

   <div className="Home">
      <p className="Home_intro">My name is Siddhi.<br/>
       I am passionate about learning new things, <br/>
       experimenting with new technologies, <br/>
       and sharing your knowledge with others. </p>

       <div className='Home_imgs'>
      <img src={yellowcircle} alt=""></img>
      <img src={Ellipse2} alt=""></img>
      <img src={center} alt=""></img>
       </div>
   </div>    

    <div className="Projects">
      <h4 className="Title" >Projects</h4>
      <div className="Projects_cardView">
      <Card.Group stackable className='Cards'>
        <Card>
      <Card.Content>
      <Card.Header>Wallpaper App</Card.Header>
      <Card.Meta>
        <span>Download wallpapers.<br></br>
          I am passionate about learning new things</span>
      </Card.Meta>
    </Card.Content>
    <Card.Content extra>
        <Icon name='LINK' />LINK
    </Card.Content>
  </Card>
  <Card>
      <Card.Content>
      <Card.Header>Wallpaper App</Card.Header>
      <Card.Meta>
        <span>Download wallpapers.<br></br>
          I am passionate about learning new things</span>
      </Card.Meta>
    </Card.Content>
    <Card.Content extra>
        <Icon name='LINK' />LINK
    </Card.Content>
  </Card>
  <Card>
      <Card.Content>
      <Card.Header>Wallpaper App</Card.Header>
      <Card.Meta>
        <span>Download wallpapers.<br></br>
          I am passionate about learning new things</span>
      </Card.Meta>
    </Card.Content>
    <Card.Content extra>
        <Icon name='LINK' />LINK
    </Card.Content>
  </Card>
  <Card>
      <Card.Content>
      <Card.Header>Wallpaper App</Card.Header>
      <Card.Meta>
        <span>Download wallpapers.<br></br>
          I am passionate about learning new things</span>
      </Card.Meta>
    </Card.Content>
    <Card.Content extra>
        <Icon name='LINK' />LINK
    </Card.Content>
  </Card>

  </Card.Group>
      </div>
    </div>

    <div className="Contact">
    <h4 className="Title" >Contact</h4>
    <div className="Contact_logo">
     <a href="http://"> <FiInstagram className='Contact_logo1'/>
     </a>
     <a href="http://">  <FiLinkedin className='Contact_logo1'/> </a>
     <a href="http://"> <FiGithub className='Contact_logo1'/> </a>
    {/* <img src={linkedin} alt=""></img>
    <img src={insta}></img>
    <img src={th}></img> */}

    </div>
    </div>

    </div>

  );
}

export default App;
